import React from "react";
// import { Link } from "react-router-dom";
// import { HttpGetHelper } from "../helpers";

// components

import Navbar from "components/Navbars/AuthNavbar.js";
import Footer from "components/Footers/Footer.js";

export default function History() {
  //   const [data, setData] = useState(null);

  //   useEffect(() => {
  //     const fetch = async () => {
  //       const httpResponse = await HttpGetHelper.getData(
  //         "https://covid19.mathdro.id/api/countries/ID/confirmed",
  //         {}
  //       );
  //       if (httpResponse) {
  //         setData(httpResponse);
  //       }
  //     };

  //     fetch();
  //   }, []);

  return (
    <>
      <Navbar class="bg-blueGray-800" />
      <main>
        <section className="relative py-20">
          <div className="container mx-auto px-4 h-full">
            <div className="items-center flex flex-wrap">
              <div className="w-full md:w-8/12 ml-auto mr-auto p-4 flex flex-wrap">
                <div className="shadow-md m-2 w-1/2">
                  <div className="flex justify-between items-center py-1">
                    Mifta
                    <span>12 Juli 2020</span>
                  </div>
                  <div className="flex justify-between items-center py-1">
                    Hasil Diagnosa
                    <span>20% - Negatif</span>
                  </div>
                  <p>Hanya terkena gejala flu ringan saja.</p>
                </div>
              </div>
              <div
                className="w-full md:w-4/12 ml-auto mr-auto p-4 my-auto"
                style={{ height: "24rem" }}
              >
                <div className="text-center">
                  <h3 className="text-3xl font-semibold">Sesi Diagnosis</h3>
                  <div className="mt-4 text-md leading-relaxed text-blueGray-500">
                    <p>
                      Dalam sesi diagnosis ini, kamu akan diberikan beberapa
                      pertanyaan seputar kesehatan yang harus dijawab sesuai
                      dengan kondisi sebenarnya kesehatan kamu.
                    </p>
                  </div>
                  <div className="mt-8">
                    <button
                      // onClick={() => setStart(!start)}
                      className="px-6 py-2 text-xs font-bold bg-lightBlue-400 active:bg-lightBlue-100 uppercase text-white px-4 py-2 rounded shadow hover:shadow-md outline-none focus:outline-none lg:mr-1 lg:mb-0 mb-3 ease-linear transition-all duration-150"
                    >
                      Mulai
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
}
